PARABÉNS melhor presidente de todos MITO 2022
esta garantido com recorde de aprovação petralhada vai chora a noite toda :
1- Baixou de 39 para 22 Ministérios, gerando economia
para os cofres públicos;
2- Nenhum de seus ministros foram por
indicação política, mas sim por serem especialistas no cargo;
3- Abriu
a caixa preta do BNDES, que terá de devolver ao tesouro nacional R$
316 Bilhões roubados pelo PT;
4- Cortou 2,5 Bilhões de verbas de
patrocínio com a Globo e outras empresas televisivas, e criou um canal
oficial do governo no Youtube;
5- Cortou milhares de cargos
comissionados;
6- Desbaratou a quadrilha que usava os índios para a
criação de criptomoedas;
7- Descobriu que os aviões do SUS estavam
sendo utilizados para o transporte de drogas;
8- Cortou a obrigação dos
trabalhadores de pagar o imposto sindical;
9- Criou a PEC da
Previdência, para cortar privilégios de políticos, militares e
funcionários públicos. Agora, quem ganha mais paga mais, quem ganha
menos paga menos;
10- Gerou saldo positivo nas contas do governo de R$
30,2 bilhões em 3 meses;
11- Mudou a “Lei Rouanet”, que passou a
beneficiar apenas artistas não consagrados;
12- Cortou a suntuosa verba
do Carnaval e outros eventos, passando a responsabilidade a ser dos
próprios idealizadores;
13- Mudou a validade da CNH de 5 para 10 anos;
14- Desvendou as fraudes no BOLSA FAMÍLIA, onde os benefícios iam para
pessoas mortas, empresários e funcionários fantasmas;
15- Exonerou seu
próprio ministro e mandou que a Polícia Federal investigasse seu
partido;
16- Mostrou ao mundo como a esquerda deixou o Brasil depois de
20 anos, ao postar um vídeo em seu Twitter com cenas imorais de
foliões em local público;
17- Fez a maior aliança entre Brasil e
Estados Unidos, recebendo em rede televisiva o compromisso do
Presidente Trump de turbinar economicamente as relações entre os dois
países.
“Brasil Acima de Tudo, Deus Acima de Todos”
